import { Link } from 'react-router-dom'
import style from './Footer.module.css'

const Footer = () => {
  return (
    <div className={style.footer}>
      <Link> <h3>Main</h3> </Link>
      <Link> <h3>Community</h3> </Link>
      <Link> <h3>Login</h3> </Link>
    </div>
  )
}

export default Footer
